import React, {Component} from 'react';


function MonsterEyes(props){

    return(
        <div className="monster"
             style={{
                 position:'absolute',
                 left:props.left,
                 top:props.top,
                }}>
            <div className="monster_sprite"></div>
        </div>
    );
}

export default MonsterEyes
